export default ParseWeatherToIcon = (description) => {
    switch (description) {
        case 'clear sky':
            return 'wi-day-sunny';
        case 'few clouds':
            return 'wi-cloudy';
        case 'scattered clouds':
            return 'wi-cloudy';
        case 'broken clouds':
            return 'wi-cloudy';
        case 'shower rain':
            return 'wi-showers';
        case 'rain':
            return 'wi-rain';
        case 'thunderstorm':
            return 'wi-thunderstorm';
        case 'snow':
            return 'wi-snow';
        case 'mist':
            return 'wi-dust';
    }
}
